function Font(stage) {
    this.init(stage);    
};

Font.prototype.init = function (stage) {
    this.fontName = "TS-Oswald-Light";
    this.charSvg = [];
	this.charSvgObj = {};
    this.charVector = [];
	this.unit_size = 1000;
	this.stage = stage;
	this.setFont(this.fontName);
};

Font.prototype.parseCSV = function (csvString) {
  const lines = csvString.split(/\r?\n/);
  this.charSvg = [];
  this.charSvgObj = {};
  for (const line of lines) {
    if (line.trim() === '') continue;
    const row = line.split(',');
	if (row[0] == "comma") {row[0] = ",";}
    const trimmedRow = row.map(field => field.trim());  
    this.charSvg.push(trimmedRow);
	this.charSvgObj[trimmedRow[0]] = {};
	this.charSvgObj[trimmedRow[0]]['svg'] = trimmedRow[1];
	if (trimmedRow[2]) {
		this.charSvgObj[trimmedRow[0]]['width'] = trimmedRow[2];
	} else {
		this.charSvgObj[trimmedRow[0]]['width'] = 0;
	}
  }
};

Font.prototype.setFont = function (newFont) {
	if (this.fontName !== newFont || this.charSvg.length == 0) {
		this.fontName = newFont;
		if ( newFont == "TS-Inter-Regular" ) {
			this.parseCSV(inter_regular_svg);
			this.unit_size = 2048;
		} else if ( newFont == "TS-Serif-Regular" ) {
			this.parseCSV(breeSerif_regular_svg);	
			this.unit_size = 1024;
		} else if ( newFont == "TS-Oswald-Regular" ) {
			this.parseCSV(oswald_regular_svg);
			this.unit_size = 1000;
        } else if ( newFont == "TS-Courgette-Regular" ) {
			this.parseCSV(courgette_regular_svg);
			this.unit_size = 2048;
        } else if ( newFont == "TS-Linea-Thin" ) {
			this.parseCSV(linea_thin_svg);
			this.unit_size = 640;
		} else if ( newFont == "TS-Lato-Black" ) {
			this.parseCSV(lato_black_svg);
			this.unit_size = 2000;
		} else if ( newFont == "TS-Lato-Light" ) {
			this.parseCSV(lato_light_svg);
			this.unit_size = 2000;
		} else if ( newFont == "TS-Oswald-Light" ) {
			this.parseCSV(oswald_light_svg);
			this.unit_size = 1000;
        }
	}
};

Font.prototype.returnFontList = function () {
	return new List(this.charSvg.map(command => new List(command)));
};


