IDE_Morph.prototype.fontLicense = function () {
    var dlg, aboutTxt, pic, world = this.world();

    aboutTxt = 'TurtleStich! Font License Notice\n\n'

        + 'This project incorporates fonts that are licensed under\n'
        + 'the SIL Open Font License (OFL) Version 1.1.\n\n'

		
        + 'The original font files were sourced from Google Fonts\n'
		+ 'and converted into vector format for use in TurtleStitch.\n\n'


    dlg = new DialogBoxMorph();
    dlg.inform(localize('About Font License'), localize(aboutTxt), world, this.logo.cachedTexture);


    btn1 = dlg.addButton(
		function () {
            window.open('https://openfontlicense.org/', '');
        },
        'SIL OFL License',
    );
    dlg.fixLayout();
};

SnapExtensions.buttons.palette.push({
    category: 'Font',
    label: 'License',
    hideable: false,
    action: function () {
        var ide = this.parentThatIsA(IDE_Morph);
        ide.fontLicense();
    }
});

(function() {
    var ide = world.children[0],
        stage = ide.stage;
		
    // Redo palette so the button actually shows up
    ide.flushBlocksCache();
    ide.refreshPalette();
	
    if (!stage.font) {
        stage.font = new Font(stage);
    }
})();

SnapExtensions.primitives.set('eg_setFont(newFont)', function (newFont) {
    var stage = this.parentThatIsA(StageMorph);
    if (!stage.font) { return; }
	stage.font.setFont(newFont);
});

SnapExtensions.primitives.set('eg_unit_size()', function () {
    var stage = this.parentThatIsA(StageMorph);
    if (!stage.font) { return; }
	return stage.font.unit_size;
});

SnapExtensions.primitives.set('eg_font_types()', function () {
	return new List(['TS-Inter-Regular',
	                 'TS-Serif-Regular',
					 'TS-Oswald-Regular',
					 'TS-Oswald-Light',
					 'TS-Courgette-Regular',
					 'TS-Linea-Thin',
					 'TS-Lato-Black',
					 'TS-Lato-Light'
					 ]);
});

SnapExtensions.primitives.set('eg_font_list()', function () {
    var stage = this.parentThatIsA(StageMorph);
    if (!stage.font) { return; }
	return stage.font.returnFontList();
});

SnapExtensions.primitives.set('eg_font_name()', function () {
    var stage = this.parentThatIsA(StageMorph);
    if (!stage.font) { return; }
	return stage.font.fontName;
});

SnapExtensions.primitives.set('eg_get_svg(chr)', function (chr) {
    var stage = this.parentThatIsA(StageMorph);
    if (!stage.font) { return; }
	return stage.font.charSvgObj[chr]['svg'];
});

SnapExtensions.primitives.set('eg_get_width(chr)', function (chr) {
    var stage = this.parentThatIsA(StageMorph);
    if (!stage.font) { return; }
	return stage.font.charSvgObj[chr]['width'];
});

